import Slider from "react-slick";
import photo from "../../assets/profile_photo.jpg";

function CarouselComponent() {
    var settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1,
    };
    return (
        <div className="carousel_container">
            <Slider {...settings} >
                <div className="carousel_slide">
                  <h1> Developets </h1>
                  <p> Information information information information information </p>
                  <img src={photo}></img>
                </div>
                <div className="carousel_slide">
                  <h1> OCR Tool </h1>
